import React from "react";
import {
  TaskbarContainer,
  TasksWrapper,
  TasksList,
  ListItem,
} from "./taskbar.styles";
const Taskbar = () => {
  return (
    <TaskbarContainer>
      <Wrapper>
        <TasksList>
          <ListItem>Description</ListItem>
          <ListItem>Information</ListItem>
          <ListItem>Reviews (2)</ListItem>
        </TasksList>
      </Wrapper>
    </TaskbarContainer>
  );
};

export default Taskbar;
